import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import api from '../services/api';

interface TutorProfile {
    id: number;
    headline: string;
    description: string;
    hourlyRate: number;
    user: { id: number; username: string; };
}

interface Availability {
    id: number;
    startTime: string;
    endTime: string;
    isBooked: boolean;
}

interface Review {
    id: number;
    rating: number;
    comment: string;
    student: { username: string; };
}

const TutorProfilePage: React.FC = () => {
    const { id } = useParams<{ id: string }>();
    const [profile, setProfile] = useState<TutorProfile | null>(null);
    const [availability, setAvailability] = useState<Availability[]>([]);
    const [reviews, setReviews] = useState<Review[]>([]);
    const [loading, setLoading] = useState(true);
    const [bookingStatus, setBookingStatus] = useState('');

    useEffect(() => {
        if (id) {
            setLoading(true);
            Promise.all([
                api.get(`/api/profiles/tutor/${id}`),
                api.get(`/api/tutor/${id}/availability`),
                api.get(`/api/reviews/tutor/${id}`)
            ]).then(([profileRes, availabilityRes, reviewsRes]) => {
                setProfile(profileRes.data);
                setAvailability(availabilityRes.data);
                setReviews(reviewsRes.data);
            }).catch(error => {
                console.error('Failed to fetch tutor data', error);
            }).finally(() => {
                setLoading(false);
            });
        }
    }, [id]);

    const handleBookSlot = async (slotId: number) => {
        setBookingStatus('Booking...');
        try {
            await api.post(`/api/student/book?slotId=${slotId}`);
            setBookingStatus('Booking successful! The page will refresh.');
            setTimeout(() => window.location.reload(), 2000);
        } catch (error) {
            console.error('Booking failed', error);
            setBookingStatus('Booking failed. The slot might be already taken.');
        }
    };

    if (loading) {
        return <p className="text-center text-gray-500">Loading profile...</p>;
    }

    if (!profile) {
        return <p className="text-center text-red-500">Failed to load tutor profile.</p>;
    }

    return (
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
            {/* Left Column: Profile Info */}
            <div className="lg:col-span-2 bg-white p-8 rounded-lg shadow-md">
                <h2 className="text-3xl font-bold text-gray-900">{profile.headline}</h2>
                <p className="text-lg text-gray-600 mt-1">Tutor: {profile.user.username}</p>
                <p className="text-2xl font-bold text-indigo-600 mt-4">${profile.hourlyRate}/hr</p>
                <div className="mt-6 border-t border-gray-200 pt-6">
                    <h3 className="text-xl font-semibold text-gray-800">About Me</h3>
                    <p className="text-gray-700 mt-2">{profile.description}</p>
                </div>
            </div>

            {/* Right Column: Availability */}
            <div className="space-y-6">
                <div className="bg-white p-6 rounded-lg shadow-md">
                    <h3 className="text-xl font-semibold text-gray-800 mb-4">Available Slots</h3>
                    <div className="space-y-3 max-h-96 overflow-y-auto">
                        {availability.filter(slot => !slot.isBooked).map(slot => (
                            <div key={slot.id} className="flex justify-between items-center p-3 bg-gray-50 rounded-lg">
                                <div>
                                    <p className="font-medium text-gray-800">{new Date(slot.startTime).toLocaleDateString()}</p>
                                    <p className="text-sm text-gray-600">{new Date(slot.startTime).toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' })} - {new Date(slot.endTime).toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' })}</p>
                                </div>
                                <button onClick={() => handleBookSlot(slot.id)} className="bg-green-500 text-white font-bold py-2 px-3 rounded-lg hover:bg-green-600 transition duration-300 text-sm">
                                    Book
                                </button>
                            </div>
                        ))}
                        {availability.filter(slot => !slot.isBooked).length === 0 && (
                            <p className="text-center text-gray-500 py-4">No available slots.</p>
                        )}
                    </div>
                    {bookingStatus && <p className="mt-4 text-center text-sm font-medium text-indigo-600">{bookingStatus}</p>}
                </div>
            </div>

            {/* Bottom Section: Reviews */}
            <div className="lg:col-span-3 bg-white p-8 rounded-lg shadow-md">
                <h3 className="text-2xl font-semibold text-gray-800 mb-6">Reviews</h3>
                <div className="space-y-6">
                    {reviews.length > 0 ? reviews.map(review => (
                        <div key={review.id} className="border-b border-gray-200 pb-4">
                            <div className="flex items-center mb-2">
                                <p className="font-bold text-gray-800 mr-4">{review.student.username}</p>
                                <div className="flex items-center">
                                    {[...Array(5)].map((_, i) => (
                                        <svg key={i} className={`w-5 h-5 ${i < review.rating ? 'text-yellow-400' : 'text-gray-300'}`} fill="currentColor" viewBox="0 0 20 20">
                                            <path d="M9.049 2.927c.3-.921 1.603-.921 1.902 0l1.07 3.292a1 1 0 00.95.69h3.462c.969 0 1.371 1.24.588 1.81l-2.8 2.034a1 1 0 00-.364 1.118l1.07 3.292c.3.921-.755 1.688-1.54 1.118l-2.8-2.034a1 1 0 00-1.175 0l-2.8 2.034c-.784.57-1.838-.197-1.539-1.118l1.07-3.292a1 1 0 00-.364-1.118L2.98 8.72c-.783-.57-.38-1.81.588-1.81h3.461a1 1 0 00.951-.69l1.07-3.292z" />
                                        </svg>
                                    ))}
                                </div>
                            </div>
                            <p className="text-gray-600">{review.comment}</p>
                        </div>
                    )) : (
                        <p className="text-center text-gray-500">No reviews for this tutor yet.</p>
                    )}
                </div>
            </div>
        </div>
    );
};

export default TutorProfilePage;
